CREATE TRIGGER [dbo].[UpdateColiTotal]
ON [dbo].[Product]
AFTER INSERT, UPDATE
AS
BEGIN
    IF UPDATE(coli_in) OR UPDATE(coli_out)
    BEGIN
        UPDATE p
        SET p.coli_total = ISNULL(i.coli_in, 0) - ISNULL(i.coli_out, 0)
        FROM [dbo].[Product] p
        INNER JOIN inserted i ON p.id = i.id
    END
END;
GO
ALTER TABLE [dbo].[Product] ENABLE TRIGGER [UpdateColiTotal]
GO
