CREATE TRIGGER [dbo].[DeleteProductQuantityOut]
ON [dbo].[Sales_Detail]
AFTER DELETE
AS
BEGIN
    SET NOCOUNT ON;

    UPDATE [dbo].[Product]
    SET quantity_out = p.quantity_out - d.quantity
    FROM [dbo].[Product] AS p
    INNER JOIN deleted AS d ON p.id = d.id_product;
END;
GO
ALTER TABLE [dbo].[Sales_Detail] ENABLE TRIGGER [DeleteProductQuantityOut]
GO
/****** Object:  Trigger [dbo].[UpdateProductQuantityOut]    Script Date: 11/20/2023 1:44:49 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE TRIGGER [dbo].[UpdateProductQuantityOut]
ON [dbo].[Sales_Detail]
AFTER INSERT
AS
BEGIN
    SET NOCOUNT ON;

    UPDATE [dbo].[Product]
    SET quantity_out = quantity_out + i.quantity
    FROM [dbo].[Product] AS p
    INNER JOIN [dbo].[Sales_Detail] AS sd ON p.id = sd.id_product
    INNER JOIN inserted AS i ON sd.id = i.id
    WHERE i.id_transaction IN (SELECT id FROM [dbo].[Transaction] WHERE [type] = 'sales');
END;
GO
ALTER TABLE [dbo].[Sales_Detail] ENABLE TRIGGER [UpdateProductQuantityOut]
